{"id": 20, "url": "https://www.apartmentfinder.com/California/Santa-Barbara-Apartments/Ivy-Santa-Barbara-Apartments-qwwq30x", "title": "Ivy Santa Barbara Apartments", "location": "203 Ladera St, Santa Barbara, CA  93101", "rent_special": "$1000 off first month's rent at Ivy at Carrillo! Contact the Property Manager for more details.", "price_range": "$2,195 - $4,795", "beds": "1 - 3", "bath": "1 - 2", "lease_term": "12", "assigned_garage_parking_price": "", "assigned_other_parking_price": "", "cat_rent": "", "dog_rent": "", "application_fee": "$30", "cat_deposit": "$300", "dog_deposit": "", "apartment_description": "Experience all that Santa Barbara has to offer at Ivy Apartment Homes. Brighten every morning by taking a short five minute walk to the nearby beaches in Southern California\u2019s yearlong beautiful weather. Cruise down iconic State Street or enter the lively Funk Zone to indulge in a variety of restaurants, bars, and upscale shopping or simply allow yourself to be swept away by the culture and work of local artists.\nHome here is the perfect mix of privacy and sense of community. Relax on your plush leather sofa, included in fully-furnished units, or invite friends and family over to take advantage of the courtyard common areas, set up perfectly for lounging and socializing. Ivy Apartment Homes offers a variety of floor plans and locations with the goal of providing each of our residents with their own personal paradise. There are just so many really fun things to do in Santa Barbara and Goleta to keep your college life filled with adventure and beautiful sights! From kayaking, sailing and hiking, to shopping on State Street, waterfront restaurants and the Santa Barbara Zoo. There's even a drive-in movie theater if that suits your fancy. And be sure to make Stearn's Wharf a destination. There you can ride the Water Taxi, enjoy marine life at the Sea Center, cast your line at the edge of the wharf - or even see what your future holds at Madame Rosinkas. This is Santa Barbara! An area where there are so many things to do and the weather is always beautiful! It's an understatement to say that Santa Barbara has outstanding beaches... and plenty of them. And in case you've heard that the Santa Barbara sun sets in the North, well, the laws of physics here are no different. The thing is, most SB beaches face south rather than west. What you're left with is a quality and quantity of beaches that surpasses your expectations. Many of the beach areas have plenty of amenities, and many are long, private and simply gorgeous! Have fun visiting each and every one of these great spots: Arroyo Burro Beach, Butterfly Beach, Carpinteria City, Carpinteria State, East Beach, El Capitan State, Gaviota State, Goleta Beach, Guadalupe Dunes, Hammond's Beach, Jalama Beach, Lead-better, Lookout Park, Ocean Beach, Refugio State, Rincon Beach, Sands Beach, Santa Claus Lane, West Beach.", "office_hour": {"Monday": {"time_open": "9AM", "time_close": "6PM"}, "Tuesday": {"time_open": "9AM", "time_close": "6PM"}, "Wednesday": {"time_open": "9AM", "time_close": "6PM"}, "Thursday": {"time_open": "9AM", "time_close": "6PM"}, "Friday": {"time_open": "9AM", "time_close": "6PM"}, "Saturday": {"time_open": "9AM", "time_close": "6PM"}, "Sunday": {"time_open": "9AM", "time_close": "6PM"}}, "special_features": [], "community_features": ["Laundry Facilities", "Renters Insurance Program", "Laundry Service", "Planned Social Activities", "Fenced Lot", "Sundeck", "Courtyard", "Grill", "Picnic Area"], "floorplan_amenities": ["Heating", "Cable Ready", "Tub/Shower", "Dishwasher", "Disposal", "Kitchen", "Microwave", "Oven", "Refrigerator", "Window Coverings", "Balcony", "Grill"], "parking": [], "pet_policy": "Cats Allowed", "airport": {"Santa Barbara Municipal": {"drive": "28 min", "distance": "12.3 mi"}}, "universities": {"Santa Barbara City College": {"drive": "2 min", "distance": "0.5 mi"}, "University of California, Santa Barbara": {"drive": "18 min", "distance