{"id": 144, "url": "https://www.apartmentfinder.com/California/Westminster-Apartments/Tres-Vidas-Apartments", "title": "Tres Vidas Apartments", "location": "15130 Brookhurst St, Westminster, CA  92683", "rent_special": "", "price_range": "$1,490 - $1,995", "beds": "Studio - 2", "bath": "1 - 2", "lease_term": "12 Months", "assigned_garage_parking_price": "", "assigned_other_parking_price": "", "cat_rent": "", "dog_rent": "", "application_fee": "$40", "cat_deposit": "", "dog_deposit": "", "apartment_description": "Tres Vidas Apartments is the classic Garden Style apartment community with vintage Southern California charm, set in Westminster within minutes of many of Orange County\u2019s prime features. Its beautifully maintained Spanish Revival style grounds, built in the 1970s golden era of spaciously planned garden apartments, give our residents a tranquil and wide open natural setting to enjoy the Southern California climate, while being conveniently positioned on a beautiful boulevard thoroughfare \u2013 just 5 minutes away from Mile Square Park and in proximity to freeways, excellent cuisine, shopping and exceptional beaches. Tres Vidas is full of pleasant surprises, not least of which is significantly lower rental rates than comparable apartment communities in the region, making its value unmatched by competitors. \n\nFloor plan options at Tres Vidas are streamlined for simplicity, with 3 perfect plans to select from: STUDIO, 1 BEDROOM, and 2 BEDROOM-2 BATH \u2013 all boasting large balconies or patios, post-and-beam architecture with exposed timber details, sloped wood ceilings, and wood floors (coming soon). Our community is also well equipped with a variety of indoor and outdoor recreation including tennis courts, sand volleyball, swimming pool, covered Jacuzzi, billiards, table tennis, and ample green space between buildings; important security features like controlled-access gates, carports, and covered exterior stairways; and our friendly office and clubho